import React from 'react';

const Starred = ({ starred }) => (
    <div className="card card-body mb-2">
        <div className="row">
            <div className="col-mb-6">
            <span className="badge badge-primary"> Nome do repositório: { starred.name }</span>
            </div>
            <div className="col-md-6">
                <span className="badge badge-secondary"> Criador do repositório: { starred.owner.login}</span>
            </div>
        </div>
    </div>
)

export default Starred;

